svg.script:

var ids=[{'txt':'b1-txt','circle':'b1-circle'}];
var seq =0;
var opacity = '0.090535';
var withOp = _.bind(opacityBullet,{'cop':opacity,'top':1});
var withoutOp = _.bind(opacityBullet,{'cop':0,'top':0});

function opacityBullet(bullet) {
   targetshape = document.getElementById(bullet.circle); 
   targetshape.setAttribute("style", "opacity:"+this.cop);
   targetshape = document.getElementById(bullet.txt); 
   targetshape.setAttribute("style", "opacity:"+this.top);
   alert(targetshape.animate);
}
function load(evt) {
    _.each(ids,withoutOp);
    if (document.layers) document.captureEvents(Event.KEYDOWN);
    document.onkeydown = function (evt) {
     var keyCode = evt ? (evt.which ? evt.which : evt.keyCode) : event.keyCode;
     if (keyCode == 13) { 
        if(seq < ids.length){
           withOp(ids[seq++]); 
        }
     }
     if (keyCode == 27) { 
        if(seq > 0 ){
           withoutOp(ids[seq--]);
        }
     }
     else return true;
   };

}
